package application

import (
	"github.com/MR5356/elune-backend/pkg/persistence"
	"github.com/MR5356/elune-backend/pkg/persistence/cache"
	"github.com/MR5356/elune-backend/pkg/persistence/database"
)

type Service struct {
	persistence *persistence.Persistence[*Application]
}

func NewService(db *database.Database, cache cache.Cache) *Service {
	return &Service{
		persistence: persistence.New(db, cache, &Application{}),
	}
}

func (s *Service) ListApplication() ([]*Application, error) {
	return s.persistence.List(&Application{})
}

func (s *Service) Initialize() error {
	err := s.persistence.DB.AutoMigrate(&Application{})
	if err != nil {
		return err
	}

	defaultApps := []*Application{
		{
			ID:    1,
			Title: "Syncer",
			Desc:  "多功能的迁移工具，支持docker镜像迁移、git仓库迁移",
			Link:  "https://github.com/MR5356/syncer",
			Logo:  "data:image/png;base64,",
			Order: 9,
			OS:    []string{"Linux", "MacOS", "Windows"},
			Note:  "开源软件",
		},
		{
			ID:    2,
			Title: "Image Save",
			Desc:  "不依赖Docker Daemon的镜像下载工具",
			Link:  "https://github.com/DockerContainerService/image-save",
			Logo:  "data:image/png;base64,",
			Order: 5,
			OS:    []string{"Linux", "MacOS", "Windows"},
			Note:  "开源软件",
		},
		{
			ID:    3,
			Title: "兔儿工具箱",
			Desc:  "综合工具箱软件",
			Link:  "https://github.com/toodo-fun/tool",
			Logo:  "data:image/x-icon;base64,",
			Order: 1,
			OS:    []string{"Windows"},
			Note:  "开源软件",
		},
	}
	for _, app := range defaultApps {
		_ = s.persistence.Insert(app)
	}

	return nil
}
